import React,{useEffect, useState} from 'react';
import groupBy from 'lodash.groupby';
import sortBy from 'lodash.sortby';
import omit from 'lodash.omit';
import {requestToAPI} from './API/API';
import Buildings from './components/Building';
import './App.css';

function App() {

  const [result,setResult] = useState([]);

  useEffect(()=>{
    requestToAPI().then((result)=>{
      setResult(result.items);
    });
  },[]);

  const buildingZones = omit(groupBy(result, 'buildingzone'),[""]);

  return (
    <div className="App">
      {Object.keys(buildingZones).map((buildingZone,index)=>{
        return <Buildings buildingZone={buildingZone} buildings={buildingZones[buildingZone]} key={index}/>
      })}
      <Buildings buildingZone="Others" buildings={buildingZones[""]} />
    </div>
  );
};

export default App;
